deck_description:
Use Golem effect to special summon either searcher to blow up opponent board with searcher special summon effect. or special summon goblin to put 0 atk monster that cannot be destroyed by battle to bypass opponents beefy monsters.

Try to get both searcher in graveyard  so you can abuse their non once per turn effects of special summoning themselves if a scrap is destroyed by card effect to link summon.

